LAST & FINAL CAPTION -

These days have given us a lot of time to think -
And while most people think about what’s visible to the eye, only a mother’s eye can see beyond what’s at the surface.

Every morning, as she wakes up earlier than the entire home, she reflects upon everything in her life. 
Deep in thoughts, she pens a poetry in her mind, every morning... And so, I, alongwith my group of Mommee, thought of presenting our ‘Reflections Of Lockdown’ to you through this video.

I hope you like it as much as we do.

SOUND ON FOR THIS ONE, please ❤
